import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { TextField, Button, List, ListItem, ListItemText, IconButton } from '@mui/material';
import DeleteIcon from '@mui/icons-material/Delete';

function AssetManager() {
    const [assets, setAssets] = useState([]);
    const [newAsset, setNewAsset] = useState('');

    useEffect(() => {
        const fetchAssets = async () => {
            try {
                const response = await axios.get('/api/assets');
                setAssets(response.data);
            } catch (error) {
                console.error('Error fetching assets:', error);
            }
        };
        fetchAssets();
    }, []);

    const handleAddAsset = async () => {
        try {
            const response = await axios.post('/api/assets', { name: newAsset });
            setAssets([...assets, response.data]);
            setNewAsset('');
        } catch (error) {
            console.error('Error adding asset:', error);
        }
    };

    const handleDeleteAsset = async (id) => {
        try {
            await axios.delete(`/api/assets/${id}`);
            setAssets(assets.filter((asset) => asset._id !== id));
        } catch (error) {
            console.error('Error deleting asset:', error);
        }
    };

    return (
        <div>
            <h2>Asset Manager</h2>
            <TextField
                label="New Asset"
                value={newAsset}
                onChange={(e) => setNewAsset(e.target.value)}
                fullWidth
                margin="normal"
            />
            <Button variant="contained" color="primary" onClick={handleAddAsset}>
                Add Asset
            </Button>
            <List>
                {assets.map((asset) => (
                    <ListItem key={asset._id}>
                        <ListItemText primary={asset.name} />
                        <IconButton edge="end" aria-label="delete" onClick={() => handleDeleteAsset(asset._id)}>
                            <DeleteIcon />
                        </IconButton>
                    </ListItem>
                ))}
            </List>
        </div>
    );
}

export default AssetManager;
